import React,{Component} from 'react';
import './home.css';
import App1 from './faqfun';
import Aos ,{useEffect} from 'aos';
import 'aos/dist/aos.css';
import { BiMobile ,BiLaptop} from "react-icons/bi";
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Carousel} from 'react-bootstrap';
import image1 from '././testimonials/1.png';
import image2 from '././testimonials/2.png';
import image3 from '././testimonials/3.png';

const Home =()=> {

    useEffect(()=>
    {
      Aos.init({duration:2000});
    },[]);

    return (
      <div className="Home"  style={{backgroundcolor:'black'}}>

      <div className="pa3 home1">
       &nbsp;
      <h1>Think twice </h1>
      <h1><span className="code" >code</span> once</h1>
      <p >
         I am a software engineer, a passionate coding enthusiast, in love with
    solving real world problems with the power of coding since i was 13. I am
    highly organized, I take my time to analyze before I move forward and I
    aspire to utilize my skills in an organization which gives me an opportunity
                    to learn and grow.
      </p>
      &nbsp;
      &nbsp;
      </div>
             <div>
             <img src={logo} alt="debugged icon" className="logo grow "/>
             </div>
             &nbsp;
             &nbsp;
    <div data-aos="fade-up" >
      <h1 className="mt4">Our <span className="code">services</span>.</h1>
      <div className="services">
        <div className="types"><BiMobile size="2em" color="#23d997"/>Android/iOS Development
        <div className="bb bw1 center mt3" ></div>
        </div>
        <div className="types"><BiLaptop size="2em" color="#23d997"/> Web Development
          <div className="bb bw1 center mt3" ></div>
        </div>
        <div className="types"><BiLaptop size="2em" color="#23d997"/> Wireframing
          <div className="bb bw1 center mt3" ></div>
        </div>
        <div className="types"><BiLaptop size="2em" color="#23d997"/> Server/Domain hosting
          <div className="bb bw1 center mt3" ></div>
        </div>
        <div className="types" ><BiLaptop size="2em" color="#23d997"/> Social Media handling
        <div className="bb bw1 center mt3" ></div>
        </div>
        <div className="types" ><BiLaptop size="2em" color="#23d997"/> Web Security
        <div className="bb bw1 center mt3" ></div>
        </div>
        <div className="types"><BiLaptop size="2em" color="#23d997"/> Digital marketing
        <div className="bb bw1 center mt3" ></div>
        </div>
      </div>
      </div>
      &nbsp;
      <div>
        <h1>Our <span className="code">testimonials</span>.</h1>
        &nbsp;
        &nbsp;
        &nbsp;
        <Carousel >

        <Carousel.Item interval={1500}>
          <img
            className="d-block w-100"
            src={image1}
            alt="First slide"
            className="test"
          />
          &nbsp;
          &nbsp;
          <h3 className="mt3">Tanmay Jagtap</h3>
          &nbsp;
          <p>We have been hands on various projects together and Abhishek is one of the best people I had as a patner,
          He has strong problem solving skills and his ability for tackling problems is remarkable! His dedication to work on
          various projects and desire to learn various technologies has always inspired me, as a team member
          Abhishek earns my highest recommendation.</p>
        <p className=" mb5">  5th January 2021</p>
        </Carousel.Item>


        <Carousel.Item interval={1500}>
          <img
            className="d-block w-100"
            src={image2}
            alt="Second slide"
            className="test"
          />
          &nbsp;
          <h3 className="mt3">Tejas Machkar</h3>
          &nbsp;
          <p>We have been hands on various projects together and Abhishek is one of the best people I had as a patner,
          He has strong problem solving skills and his ability for tackling problems is remarkable! His dedication to work on
          various projects and desire to learn various technologies has always inspired me, as a team member
          Abhishek earns my highest recommendation.</p>

          <p className=" mb5">5th January 2021</p>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={image3}
            alt="Third slide"
            className="test"
          />&nbsp;
          <h3 className="mt3">Rehan Shaikh</h3>
          &nbsp;
          <p>We have been hands on various projects together and Abhishek is one of the best people I had as a patner,
          He has strong problem solving skills and his ability for tackling problems is remarkable! His dedication to work on
           various projects and desire to learn various technologies has always inspired me, as a team member
           Abhishek earns my highest recommendation.</p>

        <p className=" mb5">  5th January 2021</p>

        </Carousel.Item>
      </Carousel>
      </div>

      <div class="ques mt5">
       <h1>Any Questions</h1>
       <h1><span className="code">FAQ</span></h1>
       &nbsp;
       &nbsp;
       <div class="ques1">
         <App1/>
      </div>
      </div>

      <footer className="footer mt6">developed by debugged.exe</footer>
      <footer  className="footer">   software engineers</footer>
      </div>
    );
}
export default Home;
